{
  "translationLines": [
    {
      "lineNumber": 163001,
      "originalJapaneseLine": "「なんだ布じじい、文句ありげだな？」",
      "translatedEnglishLine": "\"What's the matter, old cloth man? You seem to have a complaint?\""
    },
    {
      "lineNumber": 163002,
      "originalJapaneseLine": "「……いえ」",
      "translatedEnglishLine": "\"...No.\""
    },
    {
      "lineNumber": 163003,
      "originalJapaneseLine": "「いずれ儂だって、ここまではせんでも",
      "translatedEnglishLine": "\"Someday, even I, though I won't go this far,"
    },
    {
      "lineNumber": 163004,
      "originalJapaneseLine": "　似たようなことをしておりました……」",
      "translatedEnglishLine": "have done something similar...\""
    },
    {
      "lineNumber": 163005,
      "originalJapaneseLine": "「……しかし、これは大変なことに」",
      "translatedEnglishLine": "\"...However, this is a serious matter.\""
    },
    {
      "lineNumber": 163006,
      "originalJapaneseLine": "「大変なこと？」",
      "translatedEnglishLine": "\"A serious matter?\""
    },
    {
      "lineNumber": 163007,
      "originalJapaneseLine": "「むっ、いえいえ、なんでもありませんぞ……！」",
      "translatedEnglishLine": "\"Hm, no no, it's nothing...!\""
    },
    {
      "lineNumber": 163008,
      "originalJapaneseLine": "「……？」",
      "translatedEnglishLine": "\"...?\""
    },
    {
      "lineNumber": 163009,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 163010,
      "originalJapaneseLine": "その後、クルックーの指示のもと、",
      "translatedEnglishLine": "After that, under Kurukku's instructions,"
    },
    {
      "lineNumber": 163011,
      "originalJapaneseLine": "ジャロは本日の戦闘による死者と共に、",
      "translatedEnglishLine": "Jaro was respectfully buried by the Pope along with those who died in today's battle."
    },
    {
      "lineNumber": 163012,
      "originalJapaneseLine": "法王の手で丁重に葬られた。",
      "translatedEnglishLine": "(As above, this line is continuation)"
    },
    {
      "lineNumber": 163013,
      "originalJapaneseLine": "魔軍司令部――",
      "translatedEnglishLine": "Demon Army Headquarters――"
    },
    {
      "lineNumber": 163014,
      "originalJapaneseLine": "夕方、その日の戦いが終わり、",
      "translatedEnglishLine": "In the evening, after the day's battle had ended,"
    },
    {
      "lineNumber": 163015,
      "originalJapaneseLine": "レキシントンを魔物将軍達が囲んでいた。",
      "translatedEnglishLine": "the demon generals surrounded Lexington."
    },
    {
      "lineNumber": 163016,
      "originalJapaneseLine": "「ははは、たった一人でリーザス軍の連中を",
      "translatedEnglishLine": "\"Hahaha, to think you drove the Leesas army guys to the brink all by yourself!\""
    },
    {
      "lineNumber": 163017,
      "originalJapaneseLine": "　あんなに追い詰めるとは！」",
      "translatedEnglishLine": "(continued from above)"
    },
    {
      "lineNumber": 163018,
      "originalJapaneseLine": "「あの豪快な金棒さばき！",
      "translatedEnglishLine": "\"That bold handling of the golden club!"
    },
    {
      "lineNumber": 163019,
      "originalJapaneseLine": "　人間共がまるで小動物のように",
      "translatedEnglishLine": "Humans were blown away one after another like small animals!"
    },
    {
      "lineNumber": 163020,
      "originalJapaneseLine": "　ポンポンと吹き飛ばされて！」",
      "translatedEnglishLine": "(Continued)"
    },
    {
      "lineNumber": 163021,
      "originalJapaneseLine": "「さすが鬼の魔人レキシントン様！",
      "translatedEnglishLine": "\"As expected of the Oni Demon Lord Lexington-sama!"
    },
    {
      "lineNumber": 163022,
      "originalJapaneseLine": "　本当にたった一人でリーザス領を",
      "translatedEnglishLine": "You truly have the momentum to dominate the Leesas territory alone!"
    },
    {
      "lineNumber": 163023,
      "originalJapaneseLine": "　支配してしまいそうな勢いだ！」",
      "translatedEnglishLine": "(continued)"
    },
    {
      "lineNumber": 163024,
      "originalJapaneseLine": "「……あ、ああ」",
      "translatedEnglishLine": "\"...Ah, ah.\""
    },
    {
      "lineNumber": 163025,
      "originalJapaneseLine": "リック戦における醜態を知らぬ",
      "translatedEnglishLine": "Not knowing the disgrace at the Rick battle,"
    },
    {
      "lineNumber": 163026,
      "originalJapaneseLine": "魔物将軍達は口々に今日の",
      "translatedEnglishLine": "the demon generals all praised"
    },
    {
      "lineNumber": 163027,
      "originalJapaneseLine": "レキシントンの戦いぶりを称えていた。",
      "translatedEnglishLine": "Lexington's fighting today."
    },
    {
      "lineNumber": 163028,
      "originalJapaneseLine": "「さあさあ、皆、",
      "translatedEnglishLine": "\"Come now, everyone,"
    },
    {
      "lineNumber": 163029,
      "originalJapaneseLine": "　レキシントン様はお疲れなの。",
      "translatedEnglishLine": "Lexington-sama is tired."
    },
    {
      "lineNumber": 163030,
      "originalJapaneseLine": "　今日はこれくらいにして」",
      "translatedEnglishLine": "Let's call it a day here.\""
    },
    {
      "lineNumber": 163031,
      "originalJapaneseLine": "「目覚めたばかりで力も本調子じゃないから、",
      "translatedEnglishLine": "\"He just woke up and his power isn't at full strength, so"
    },
    {
      "lineNumber": 163032,
      "originalJapaneseLine": "　ちゃんと休まないといけないのよ」",
      "translatedEnglishLine": "he needs to properly rest.\""
    },
    {
      "lineNumber": 163033,
      "originalJapaneseLine": "アトランタがてきぱきと解散させることで、",
      "translatedEnglishLine": "With Atlanta efficiently dispersing them,"
    },
    {
      "lineNumber": 163034,
      "originalJapaneseLine": "ようやくレキシントンは魔物将軍達から解放された。",
      "translatedEnglishLine": "finally Lexington was freed from the demon generals."
    },
    {
      "lineNumber": 163035,
      "originalJapaneseLine": "「ふ、ふう……」",
      "translatedEnglishLine": "\"Phew...\""
    },
    {
      "lineNumber": 163036,
      "originalJapaneseLine": "「さあさあ、レキシントン様。",
      "translatedEnglishLine": "\"Come on, Lexington-sama."
    },
    {
      "lineNumber": 163037,
      "originalJapaneseLine": "　今夜はこれからどうされます？",
      "translatedEnglishLine": "What will you do from now on tonight?"
    },
    {
      "lineNumber": 163038,
      "originalJapaneseLine": "　宴の一つでも催しましょうか」",
      "translatedEnglishLine": "Shall we hold a banquet or something?\""
    },
    {
      "lineNumber": 163039,
      "originalJapaneseLine": "「う、宴……？",
      "translatedEnglishLine": "\"A banquet...?"
    },
    {
      "lineNumber": 163040,
      "originalJapaneseLine": "　い、いや……今日はもう、休む……」",
      "translatedEnglishLine": "No, no... I’ll rest today...\""
    },
    {
      "lineNumber": 163041,
      "originalJapaneseLine": "「え？　もうお休みになるのですか？」",
      "translatedEnglishLine": "\"Eh? You're going to rest already?\""
    },
    {
      "lineNumber": 163042,
      "originalJapaneseLine": "「じ、自分で言っただろう。",
      "translatedEnglishLine": "\"I-I said it myself, didn't I?"
    },
    {
      "lineNumber": 163043,
      "originalJapaneseLine": "　まだ力が取り戻せてないから、",
      "translatedEnglishLine": "I haven’t regained my strength yet,"
    },
    {
      "lineNumber": 163044,
      "originalJapaneseLine": "　休まなくちゃいけない、って」",
      "translatedEnglishLine": "so I have to rest.\""
    },
    {
      "lineNumber": 163045,
      "originalJapaneseLine": "「あ、いえ、それはどこか",
      "translatedEnglishLine": "\"N-no, it’s just that since he looked a bit"
    },
    {
      "lineNumber": 163046,
      "originalJapaneseLine": "　機嫌が悪そうだったから",
      "translatedEnglishLine": "in a bad mood, I just cleared the area...\""
    },
    {
      "lineNumber": 163047,
      "originalJapaneseLine": "　人払いしただけでして……」",
      "translatedEnglishLine": "(continues above)"
    },
    {
      "lineNumber": 163048,
      "originalJapaneseLine": "「だ、大丈夫ですよ！　レキシントン様！",
      "translatedEnglishLine": "\"I-It’s okay! Lexington-sama!"
    },
    {
      "lineNumber": 163049,
      "originalJapaneseLine": "　確かに魔血魂になる前に比べれば……",
      "translatedEnglishLine": "Certainly compared to before becoming a magical blood soul..."
    },
    {
      "lineNumber": 163050,
      "originalJapaneseLine": "　その、多少、あれですが……」",
      "translatedEnglishLine": "Well, it’s a bit like that, but...\""
    },
    {
      "lineNumber": 163051,
      "originalJapaneseLine": "「でもすぐに全盛期の力を取り戻しますわ！」",
      "translatedEnglishLine": "\"But you’ll soon regain your full strength!\""
    },
    {
      "lineNumber": 163052,
      "originalJapaneseLine": "「……うぐ。",
      "translatedEnglishLine": "\"...Ugh."
    },
    {
      "lineNumber": 163053,
      "originalJapaneseLine": "　と、当然だろう……」",
      "translatedEnglishLine": "Of course, that’s expected...\""
    },
    {
      "lineNumber": 163054,
      "originalJapaneseLine": "「全盛期の力、ねえ……」",
      "translatedEnglishLine": "\"Full strength, huh...\""
    },
    {
      "lineNumber": 163055,
      "originalJapaneseLine": "「む、ジュノー」",
      "translatedEnglishLine": "\"Hmm, Juno.\""
    },
    {
      "lineNumber": 163056,
      "originalJapaneseLine": "「本当にそんな力、取り戻せるのかな？」",
      "translatedEnglishLine": "\"Can he really regain that kind of power?\""
    },
    {
      "lineNumber": 163057,
      "originalJapaneseLine": "「なんてこと言うの！",
      "translatedEnglishLine": "\"What are you saying!"
    },
    {
      "lineNumber": 163058,
      "originalJapaneseLine": "　レキシントン様は復活したばかりで",
      "translatedEnglishLine": "Lexington-sama just revived,"
    },
    {
      "lineNumber": 163059,
      "originalJapaneseLine": "　まだ上手く力が出せないだけよ！」",
      "translatedEnglishLine": "he just can’t use his power properly yet!\""
    },
    {
      "lineNumber": 163060,
      "originalJapaneseLine": "「あ、当たり前、だろう……",
      "translatedEnglishLine": "\"O-of course...\""
    }
  ]
}

